private static java.lang.String escapeJavaStyleString(java.lang.String str, boolean escapeSingleQuotes, boolean escapeForwardSlash) {
    if (str == null) {
        return null;
    }
    try {
        java.io.StringWriter writer = new java.io.StringWriter(str.length() * 2);
        org.apache.commons.lang.StringEscapeUtils.escapeJavaStyleString(writer, str, escapeSingleQuotes, escapeForwardSlash);
        return writer.toString();
    } catch (java.io.IOException ioe) {
        ioe.printStackTrace();
        return null;
    }
}

private static void escapeJavaStyleString(java.io.Writer out, java.lang.String str, boolean escapeSingleQuote, boolean escapeForwardSlash) throws java.io.IOException {
    if (out == null) {
        throw new java.lang.IllegalArgumentException("The Writer must not be null");
    }
    if (str == null) {
        return;
    }
    int sz;
    sz = str.length();
    for (int i = 0; i < sz; i++) {
        char ch = str.charAt(i);
        if (ch > 0xfff) {
            out.write("\\u" + org.apache.commons.lang.StringEscapeUtils.hex(ch));
        } else if (ch > 0xff) {
            out.write("\\u0" + org.apache.commons.lang.StringEscapeUtils.hex(ch));
        } else if (ch > 0x7f) {
            out.write("\\u00" + org.apache.commons.lang.StringEscapeUtils.hex(ch));
        } else if (ch < 32) {
            switch (ch) {
                case '\b' :
                    out.write('\\');
                    out.write('b');
                    break;
                case '\n' :
                    out.write('\\');
                    out.write('n');
                    break;
                case '\t' :
                    out.write('\\');
                    out.write('t');
                    break;
                case '\f' :
                    out.write('\\');
                    out.write('f');
                    break;
                case '\r' :
                    out.write('\\');
                    out.write('r');
                    break;
                default :
                    if (ch > 0xf) {
                        out.write("\\u00" + org.apache.commons.lang.StringEscapeUtils.hex(ch));
                    } else {
                        out.write("\\u000" + org.apache.commons.lang.StringEscapeUtils.hex(ch));
                    }
                    break;
            }
        } else {
            switch (ch) {
                case '\'' :
                    if (escapeSingleQuote) {
                        out.write('\\');
                    }
                    out.write('\'');
                    break;
                case '"' :
                    out.write('\\');
                    out.write('"');
                    break;
                case '\\' :
                    out.write('\\');
                    out.write('\\');
                    break;
                case '/' :
                    if (escapeForwardSlash) {
                        out.write('\\');
                    }
                    out.write('/');
                    break;
                default :
                    out.write(ch);
                    break;
            }
        }
    }
}
